import React from 'react';
import '../App.css';
import Logo from '../Icons/icons8-sakura-96.png';

function Nav() {


  return (

    <nav>
    <img src={Logo}  alt="logo" />
      <ul className="nav-links">

        <li><h5>Clean Air</h5></li>
      </ul>
    </nav>
  );
}
export default Nav;
